import React, {useState} from 'react';
import axios from "axios";

const NewArticleForm = () => {

    const [formData, setFormData] = useState({
        title: "",
        header: "",
        imageUrl: "",
        body: "",
        imageUrl1: "",
        imageUrl2: "",
        imageUrl3: "",
    });

    const handleSubmit = (event) => {
        event.preventDefault();
        axios.post("http://localhost:5098/CreateArticle", formData)
            .then((response) => {
                console.log(response.data);
            })
            .catch((error) => {
                console.error("Error:", error);
            });
    };

    const handleChange = (event) => {
        const {name, value} = event.target;
        setFormData((prevFormData) => ({
            ...prevFormData,
            [name]: value,
        }));
    };


    return (
        <>
            <div className={"container"}>
                <div className={"row"}>
                    <form onSubmit={handleSubmit}>
                        <div className={"col-xl-12"}>
                            <div className={"row"}>

                                <div className={"col-xl-6 mt-xl-3"}>
                                    <input placeholder="Title" className={"form-control"} type="text" id="title"
                                           name="title" value={formData.title} onChange={handleChange}/>
                                </div>
                                <div className={"col-xl-10"}>
                                    <input placeholder="Header" type="text" id="header" name="header" value={formData.header}
                                           onChange={handleChange}/>
                                </div>
                                <div className={"col-xl-10"}>
                                    <input placeholder="ImageUrl" type="text" id="imageUrl" name="imageUrl" value={formData.imageUrl}
                                           onChange={handleChange}/>
                                </div>
                                <div className={"col-xl-10"}>
                                    <textarea placeholder="Body" id="body" name="body" value={formData.body} onChange={handleChange}/>
                                </div>
                                <div className={"col-xl-10"}>
                                    <input placeholder="ImageUrl1" type="text" id="imageUrl1" name="imageUrl1" value={formData.imageUrl1}
                                           onChange={handleChange}/>
                                </div>
                                <div className={"col-xl-10"}>
                                    <input placeholder="ImageUrl2" type="text" id="imageUrl2" name="imageUrl2" value={formData.imageUrl2}
                                           onChange={handleChange}/>
                                </div>
                                <div className={"col-xl-10"}>
                                    <input type="text" id="imageUrl3" name="imageUrl3" value={formData.imageUrl3}
                                           onChange={handleChange}/>
                                </div>
                                <div className={"col-xl-12"}>
                                    <button type="submit">Submit</button>
                                </div>
                            </div>

                        </div>
                    </form>
                </div>
            </div>
        </>
    );
};

export default NewArticleForm;
